import React from "react";
import { NavLink } from "react-router-dom";

const Header = () => {
  const navList = [
    {
      id: 1,
      path: "/",
      page: "Home",
    },
    {
      id: 1,
      path: "/",
      page: "Home",
    },
  ];
  return (
    <>
      <header className="flex items-center justify-center text-white gap-5">
        <NavLink
          to={"/"}
          className={({ isActive }) => (isActive ? "text-red-500" : "")}
        >
          Home
        </NavLink>
        <NavLink to={"/movie"}>Movie</NavLink>
      </header>
    </>
  );
};

export default Header;
